import React from 'react';
import { Link } from 'react-router-dom';
import './MovieThumb.css'

const MovieThumb = (props) => {
    return (
        <div className="rmdb-moviethumb">
            {props.clickable ? 
                <img src={props.image} alt="movie thumb" />
                :
                <img src={props.image} alt="movie thumb" />
            }
            
        </div>
    )
}


export default MovieThumb;
